import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const FormBar = ({ name }) => {
  return (
    <a>
      <span>{name}</span>
      <span>
        Pobierz <FontAwesomeIcon icon="file-alt" />
      </span>
    </a>
  );
};

export default FormBar;
